import React from 'react'
import SimpleSlider from './SimpleSlider'
import {Container} from './style'

const Carusel = () => {
    return (
       <Container style={{widht:'600px !important', height:'200px !important'}}>
           <SimpleSlider/>
       </Container>
    )
}

export default Carusel
